import React from 'react';
import ReactDOM from 'react-dom';
import Header from './Header'
import Footer from './Footer'
import './styles/content.scss';
//import * as serviceWorker from './serviceWorker';

ReactDOM.render(
  <React.StrictMode>
    <Header />
    <Footer />
  </React.StrictMode>,
  document.getElementById('root')
);

